import React from "react";
import Navbar from "./Navbar";
import Main from "./Main";
import Footer from "./Footer";

const MainPage = ({ onNavigate }) => {
  return (
    <div className="main-page">
      {/* Navbar Component */}
      <Navbar />

      {/* Main Content Section */}
      <Main />

      {/* Example Buttons */}
      <div className="button-section">
        <button onClick={onNavigate} className="btn">Go to Login (Feature 1)</button>
        <button onClick={onNavigate} className="btn">Go to Login (Feature 2)</button>
        <button onClick={onNavigate} className="btn">Go to Login (Feature 3)</button>
      </div>

      {/* Footer Component */}
      <Footer />
    </div>
  );
};

export default MainPage;
